import React, { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import useFetch from "./common/useFetch";

const UsersListingComponent = () => {
  console.log("into users Listing");
  const [users, setUsers] = useState([]);
  const [data] = useFetch(
    "https://5c3ce12c29429300143fe570.mockapi.io/api/unregisteredusers"
  );
  const dispatch = useDispatch();

  const getDataFromAPI = async () => {
    // const response = await useFetch(
    //   "https://5c3ce12c29429300143fe570.mockapi.io/api/unregisteredusers"
    // );
    console.log("UNREGISTERED: ", JSON.stringify(data));
  };

  useEffect(() => {
    getDataFromAPI();
  }, []);

  return <div>Hi</div>;
};

export default UsersListingComponent;
